import "../css/panel.css"

type CellProps = {
}

const Cell : React.FC<CellProps> = ({} : CellProps) => {
    const [neighbors, setNeighbors] = useState<[]>([]);

    return(
        <div className="cell">
        </div>
    )
}

export default function Panel() {
    const [grid, setGrid] = useState<JSX.Element[][]>();

    useEffect(() => {
        let tempOut : JSX.Element[][] = [];
        for (let j = 0; j < 10; j++) {
            let tempIn : JSX.Element[] = [];
            for (let i = 0; i < 10; i++) {
                tempIn.push(<Cell key={i}/>)
            }
            tempOut.push(tempIn);
        }
        setGrid(tempOut)
    }, [])

    return(
        <div>
            {grid?.map((x) => {
                console.log(x)
                return x;
            })}
        </div>
    );
}
